import React, { Component } from 'react';
import InfoCard from '../../componentes/InfoCard/InfoCard'
import classes from '../inicioResidente/inicioResidente.css'
import Button from "@material-ui/core/Button";
import {
    Link
} from "react-router-dom";

class inicioResidente extends Component {

    render() {
        return (
            <div className={classes['body']}>
                <InfoCard></InfoCard>
                <div className={classes['buttons']}>
                    <Link to='/'>
                        <Button m={2}
                            size="large"
                            color="primary"
                            variant="contained"
                        >Cerrar sesion</Button>
                    </Link>
                    <Link to='/RegPago'>
                        <Button m={2}
                            size="large"
                            style={classes.buttons}
                            variant="contained"
                        >Pago administracion</Button>
                    </Link>
                    <Link to='/Foro'>
                        <Button m={2}
                            size="large"
                            color="primary"
                            variant="contained"
                        >Foro Residencial</Button>
                    </Link>
                    <Button
                        classes={{
                            root: classes.root, // class name, e.g. `classes-nesting-root-x`
                            label: classes.label, // class name, e.g. `classes-nesting-label-x`
                        }}
                    >
                        classes nesting
</Button>
                </div>
            </div>
        )
    }

}
export default inicioResidente
